import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Asegúrate de crear este archivo para aplicar los estilos

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-menu">
        <li className="navbar-item"><Link to="/" className="navbar-link">Home</Link></li>
        <li className="navbar-item"><Link to="/products" className="navbar-link">Products</Link></li>
        <li className="navbar-item"><Link to="/profile" className="navbar-link">Profile</Link></li>
        <li className="navbar-item"><Link to="/checkout" className="navbar-link">Checkout</Link></li>
        <li className="navbar-item"><Link to="/login" className="navbar-link">Login</Link></li>
        <li className="navbar-item"><Link to="/register" className="navbar-link">Register</Link></li>
        {/* Add more links as needed */}
      </ul>
    </nav>
  );
};

export default Navbar;
